  true,\n\t\"url\": null,\n\t\"notes\": \"This data contains contracts which (1) cover
  City or agency-specific needs over a period of time and (2) were coordinated through
  the Bureau of Purchases in the Department of Finance.  All materials, supplies,
  equipment, and services used by City Agencies u2013 with the exception of professional
  services and public works (i.e., construction) u2013 must be obtained through the
  Bureau of Purchases. Professional services may be procured through the Board of
  Estimates with the assistance of the Law Department; public works (i.e., construction)
  may be procured through the Department of Public Works (DPW).rnMultiple listings
  in this Bureau of Purchases data reflect estimated breakdown among citywide and
  individual agency needs. Funds are encumbered against these contracts as goods or
  services are ordered. The contracts in this list have a starting date of July 1,
  2010 or later. This dataset will be updated on a monthly basis.\",\n\t\"license_title\":
